	reorderedOne.b += floatEquals(u_endianness, BIG_ENDIAN) * texelTwo.g;
	reorderedOne.a += floatEquals(u_endianness, BIG_ENDIAN) * texelTwo.r;
	reorderedTwo.r += floatEquals(u_endianness, BIG_ENDIAN) * texelOne.a;
