	flippedTwo.a += floatEquals(u_mode, INTEGER) * floatEquals(signBitIsSet, 0.0) * (texelTwo.a + 128.0)
				  + floatEquals(u_mode, INTEGER) * floatEquals(signBitIsSet, 1.0) * (texelTwo.a - 128.0);

