	gl_FragColor = floatEquals(mod(floor(gl_FragCoord.x), 2.0), 0.0) * (flippedOne.rgba / 255.0)
				 + floatEquals(mod(floor(gl_FragCoord.x), 2.0), 1.0) * (flippedTwo.rgba / 255.0);
}

